import React from 'react'
import { useNavigate } from 'react-router-dom';

const Login = () => {

    const navigate = useNavigate();

    const handleLogin = () => {
        navigate('/profile')
    }
    return (
        <div>
            login here
            <button onClick={handleLogin}>
                Login
            </button>
        </div>
    )
}

export default Login;
